import React, { useEffect } from 'react'
import '../styles/style.css'
import MyImage from '../images/homescreenthree.webp'
import Aos from 'aos'
import 'aos/dist/aos.css'
import Footer from './Footer'
import { Link } from "react-router-dom";

export default function HomePage() {

  useEffect(() => {
    Aos.init({duration: 2000});
  },[]);


  return (
    <>
    <div className="page-container">
      <img className="main-img" src={MyImage} alt="image that shows houses" />
      <h1 className="title">Plan.Build.Sell</h1>
      <div className="button-container">
        <button data-aos="flip-left"><Link className="navbar-title" to="Properties">View current projects</Link></button>
        <button data-aos="flip-right" duration="2000">3D View ( beta )</button>
      </div>
      <p className="home-paragraph">
        Lorem ipsum dolor sit amet, consectetur adip
        Lorem ipsum dolor sit amet, consectetur
        Lorem ipsum dolor sit amet
      </p>
    </div>
    <Footer />
    </>
  )
}
